entry.value:
i=0
new_dict = {}
flowFiles = session.get(9999)
for flowFile in flowFiles:
    if flowFile is not None:
        processName = context.getName()
        try:
            table_name = flowFile.getAttribute('table_name')
            print("table_name :{}".format(table_name))
            if (new_dict.get(table_name) != 1):
                new_dict[table_name] = i + 1
                session.transfer(flowFile, REL_SUCCESS)
            else:
                session.transfer(flowFile, REL_FAILURE)
            print("new_dict {}".format(new_dict))
        except Exception as ex:
            errorMsg = str(ex)
            session.putAttribute(flowFile, "errorMsg", errorMsg)
            session.putAttribute(flowFile, "processName", processName)
            session.transfer(flowFile, REL_FAILURE)

